import React from "react";

function Content({ contents }) {
  return (
    <li className="content" id={contents.id}>
      <div className="content__name">{contents.username}</div>
      <div className="content__title">{contents.title}</div>
      <div className="content__createdAt">{contents.creatAt}</div>
    </li>
  );
}

export default Content;
